function SButton (props){

    return (
        <div>
            <button className="bg-slate-950 text-white font-urbanist py-2 px-6 rounded md:ml-0 hover:bg-indigo-400
            duration-500">{props.text}</button>
        </div>
    )
}

export default SButton;
